import React, { useEffect, useState } from "react";
import { _getUserList } from "../../util/req";

export default function Index() {
  const [list, setList] = useState([]);

  const gelist = async () => {
    var res = await _getUserList();
    console.log("res -> :", res);
  };
  const del = async (id) => {
    console.log("id -> :", id);
  };

  useEffect(() => {
    gelist();
  }, []);

  return (
    <div className="info-center">
      <br />
      <br />
      <br />
      <br />
      <table>
        <thead>
          <tr>
            <th>userName</th>
            <th>password</th>
            <th>action</th>
          </tr>
        </thead>
        <tbody>
          {list.map((it, index) => (
            <tr key={index}>
              <td>{it.username}</td>
              <td>{it.password}</td>
              <td>
                <button onClick={(it) => del(it._id)}></button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
